毎日をハッピーにしてくれそうな、コカ・コーラのiPhone6Plus/6sPlus対応ハードケース。名前やメッセージなど、ご指定のアルファベット7文字を印字し、オリジナルiPhoneケースにできるパーソナライズアイテムです。<br>iPhoneの美しいフォルムをキープする、背面から側面へとシームレスに繋がるデザインで、サイドのボタンやイヤホン・USBケーブルを使う際にも邪魔になりません。<br>ポリカーボネート素材の魅力は薄くて、それなりの強度を保てるという点。お洒落に個性を演出したい方におすすです。<br><br><font color="#FF0000"><b>※本商品は【iPhone6Plus/6sPlus対応】の商品です。<br> iPhone6/6s及びiPhone7/7Plusには対応していませんので、購入の際はご注意ください。</b></font><br><br>[サイズ]<br>iPhone6Plus/6sPlus用ケース<br>16.9×8×0.8cm<br>16ｇ<br><br>[材質]<br>合成樹脂


